import React, { useState } from 'react';
import { Form } from 'react-bootstrap';

function Checkout() {
  const [paymentMethod, setPaymentMethod] = useState('');

  const handlePaymentChange = (event) => {
    setPaymentMethod(event.target.value);
  };

  return (
    <div className='Checkout'>
      <h1>Checkout</h1>
      <Form id='payment'>
        <div className="mb-3">
          <Form.Check
            onClick={handlePaymentChange}
            inline
            label="Pay by check"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-1"
            value="Pay by check"
          />
        </div>
        <div className="mb-3">
          <Form.Check
            onClick={handlePaymentChange}
            inline
            label="Credit-/Debitcard"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-2"
            value="Credit-/Debitcard"
          />
        </div>
        <div className="mb-3">
          <Form.Check
            onClick={handlePaymentChange}
            inline
            label="TWINT"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-3"
            value="TWINT"
          />
        </div>
        <div className="mb-3">
          <Form.Check
            onClick={handlePaymentChange}
            inline
            label="Apple Pay"
            name="paymentMethod"
            type={'radio'}
            id="inline-radio-4"
            value="Apple Pay"
          />
        </div>
      </Form>
      <p>Selected payment method: {paymentMethod}</p>
    </div>
  );
};

export default Checkout;
